@lill_type1 HI Tanner, you don't really know me, but I'm the Transwoman you called a slur. You were upset that I shared a video with my 340k followers to help them learn from someone I also admire. 

You may not understand Trans people, but that doesn't give you the right to degrade us without accountability.  I am a human being who helps people and uses her platform to uplift others. I do the best I can every day to be kind to people even when they aren't to me. 

I hope you are treated better than how you have treated me.  I may not like you, but I would never insult you to make you feel lesser.

What a wild thing to be in the aisle at a store ready to checkout to look over and see yourself on the cover of a magazine.  What a great way to kick off the next part of the tour!!! I'll see you tomorrow, Ottawa, IL

